INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 401, 24001, 2, 0.0, 102301, "2030/12/17 14:59:59", 0.0, 0.0, 2, "2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "アヤネ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 402, 24002, 2, 0.0, 102301, "2030/12/17 14:59:59", 0.0, 2.21, 1, "2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "アヤネ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 403, 24003, 2, 0.0, 102301, "2030/12/17 14:59:59", 0.0, 0.0, 2, "2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "アヤネ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 701, 24004, 1, 0.0, 192201, "2030/12/17 14:59:59", 0.0, 1.99, 2, "2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "アサヒ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 702, 24005, 2, 0.0, 192201, "2030/12/17 14:59:59", 0.0, 2.21, 1, "2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "アサヒ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 703, 24006, 1, 0.0, 192201, "2030/12/17 14:59:59", 0.0, 3.33, 2, "2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "アサヒ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 801, 24007, 2, 0.0, 192301, "2030/12/17 14:59:59", 0.0, 0.0, 2, "2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "部員３", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 802, 24008, 2, 0.0, 192301, "2030/12/17 14:59:59", 0.0, 2.68, 1, "2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "部員３", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 803, 24009, 2, 0.0, 192301, "2030/12/17 14:59:59", 0.0, 0.0, 2, "2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "部員３", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 501, 24010, 1, 0.0, 192501, "2030/12/17 14:59:59", 0.0, 0.0, 1, "2020/07/31 12:00:00", "やった！", "", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 502, 24011, 1, 0.0, 192501, "2030/12/17 14:59:59", 0.0, 0.0, 1, "2020/07/31 12:00:00", "勝ったよ！", "", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 503, 24012, 1, 0.0, 192501, "2030/12/17 14:59:59", 0.0, 0.0, 1, "2020/07/31 12:00:00", "いい調子！", "", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 111, 24013, 2, 0.0, 113501, "2030/12/17 14:59:59", 0.0, 5.33, 6, "2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "ミサト", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 112, 24014, 2, 0.0, 113501, "2030/12/17 14:59:59", 0.0, 6.85, 1, "2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "ミサト", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 113, 24015, 2, 0.0, 113501, "2030/12/17 14:59:59", 0.0, 3.0, 1, "2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "ミサト", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 611, 24016, 2, 0.0, 192401, "2030/12/17 14:59:59", 0.0, 6.11, 1, "2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "ダイチ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 612, 24017, 2, 0.0, 192401, "2030/12/17 14:59:59", 0.0, 6.75, 1, "2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "ダイチ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 613, 24018, 2, 0.0, 192401, "2030/12/17 14:59:59", 0.0, 0.0, 2, "2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "ダイチ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 211, 24019, 1, 0.0, 113401, "2030/12/17 14:59:59", 0.0, 4.52, 2, "2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "ハツネ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 212, 24020, 1, 0.0, 113401, "2030/12/17 14:59:59", 0.0, 3.89, 2, "2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "ハツネ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 213, 24021, 2, 0.0, 113401, "2030/12/17 14:59:59", 0.0, 13.49, 1, "2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "ハツネ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 311, 24022, 2, 0.0, 106501, "2030/12/17 14:59:59", 0.0, 3.17, 1, "2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "カヤ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 312, 24023, 2, 0.0, 106501, "2030/12/17 14:59:59", 0.0, 4.42, 1, "2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "カヤ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 313, 24024, 1, 0.0, 106501, "2030/12/17 14:59:59", 0.0, 2.89, 6, "2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "カヤ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 421, 24025, 3, 0.0, 102301, "2030/12/17 14:59:59", 0.0, 3.71, 4, "2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "アヤネ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 721, 24026, 1, 0.0, 192201, "2030/12/17 14:59:59", 0.0, 5.1, 2, "2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "アサヒ", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 821, 24027, 3, 0.0, 192301, "2030/12/17 14:59:59", 0.0, 4.34, 1, "2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "部員３", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 521, 24028, 1, 0.0, 192501, "2030/12/17 14:59:59", 0.0, 0.0, 1, "2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね", "", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 101, 24029, 2, 0.0, 113501, "2030/12/17 14:59:59", -360.0, 5.62, 1, "2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "ミサト", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 102, 24030, 2, 0.0, 113501, "2030/12/17 14:59:59", -360.0, 9.58, 1, "2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "ミサト", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 103, 24031, 2, 0.0, 113501, "2030/12/17 14:59:59", -360.0, 0.0, 2, "2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "ミサト", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 104, 24032, 1, 0.0, 113501, "2030/12/17 14:59:59", -360.0, 9.13, 2, "2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "ミサト", 24);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (10046, 105, 24033, 2, 0.0, 113501, "2030/12/17 14:59:59", -360.0, 8.27, 1, "2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "ミサト", 24);
